import React, { useEffect, useState } from 'react';
import {
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  Typography,
  Box,
  CircularProgress,
  Chip,
  TextField,
  useTheme
} from '@mui/material';
import { 
  LocalHospital,
  School,
  Security,
  SupportAgent
} from '@mui/icons-material';
import axios from 'axios';

interface CommunityResource {
  id: number;
  title: string;
  description: string;
  category: string;
  contact_info: {
    phone?: string;
    email?: string;
  };
  url?: string;
  is_active: boolean;
}

const CommunityDashboard: React.FC = () => {
  const [resources, setResources] = useState<CommunityResource[]>([]);
  const [loading, setLoading] = useState(true);
  const [searchQuery, setSearchQuery] = useState('');
  const [filterOptions, setFilterOptions] = useState({ category: '' });
  const theme = useTheme();

  // Fetch community resources
  useEffect(() => {
    const fetchResources = async () => {
      try {
        const response = await axios.get(`${process.env.COMMUNITY_API_URL}/community-resources/`, {
          params: { ...filterOptions, search: searchQuery }
        });
        setResources(response.data);
      } catch (error) {
        console.error('Error fetching resources:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchResources();
  }, [searchQuery, filterOptions]);

  // Map category to icon
  const getCategoryIcon = (category: string) => {
    switch (category.toLowerCase()) {
      case 'emergency':
        return <LocalHospital color="error" />;
      case 'education':
        return <School color="primary" />;
      case 'support':
        return <SupportAgent color="info" />;
      default:
        return <Security color="action" />;
    }
  };

  // Handle search query change
  const handleSearchChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSearchQuery(event.target.value);
  };

  // Handle filter change
  const handleFilterChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setFilterOptions(prevState => ({
      ...prevState,
      [event.target.name]: event.target.value
    }));
  };

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 3 }}>
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h6" gutterBottom sx={{ fontWeight: 'medium', mb: 3 }}>
        Community Resources
      </Typography>

      {/* Search and Filter Section */}
      <Box sx={{ mb: 3 }}>
        <TextField
          label="Search"
          value={searchQuery}
          onChange={handleSearchChange}
          variant="outlined"
          fullWidth
          sx={{ mb: 2 }}
        />
        <TextField
          label="Category"
          name="category"
          value={filterOptions.category}
          onChange={handleFilterChange}
          variant="outlined"
          fullWidth
        />
      </Box>

      {/* Resource List Section */}
      <List>
        {resources.map((resource) => (
          <ListItem
            key={resource.id}
            sx={{
              mb: 2,
              backgroundColor: '#f5f5f5',
              borderRadius: 1,
              '&:hover': {
                backgroundColor: '#eeeef0'
              }
            }}
          >
            <ListItemIcon>
              {getCategoryIcon(resource.category)}
            </ListItemIcon>
            <ListItemText
              primary={
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Typography variant="subtitle1" sx={{ fontWeight: 500 }}>
                    {resource.title}
                  </Typography>
                  <Chip
                    label={resource.category}
                    size="small"
                    sx={{
                      backgroundColor: `${theme.palette.primary.main}15`,
                      color: theme.palette.primary.main
                    }}
                  />
                </Box>
              }
              secondary={
                <>
                  <Typography variant="body2" sx={{ mt: 1 }}>
                    {resource.description}
                  </Typography>
                  <Box sx={{ mt: 1 }}>
                    {resource.contact_info.phone && (
                      <Typography variant="body2">
                        <strong>Phone:</strong> {resource.contact_info.phone}
                      </Typography>
                    )}
                    {resource.contact_info.email && (
                      <Typography variant="body2">
                        <strong>Email:</strong> {resource.contact_info.email}
                      </Typography>
                    )}
                    {resource.url && (
                      <Typography variant="body2">
                        <strong>More Info:</strong> 
                        <Link href={resource.url} target="_blank" rel="noopener">
                          Visit
                        </Link>
                      </Typography>
                    )}
                  </Box>
                </>
              }
            />
          </ListItem>
        ))}
      </List>
    </Box>
  );
};

export default CommunityDashboard;
